import { Divider, TextField, Button, FormControlLabel, Checkbox, Paper } from "@mui/material";
import { Mytext, Maindiv} from "../components/styles";
import React from "react";
import { Link } from "react-router-dom";
import { CheckBoxOutlineBlank, PersonAdd } from "@mui/icons-material";

const Signup =() =>{
    const paperStyle={padding: "10px 20px", width:350, margin:"0px auto"}
    return(
        <>
         <Paper elevation={20} style={paperStyle} >
    <div className="icon">
        <div className="icon_class">
            <PersonAdd fontsize="large"/>
        </div>
        <Mytext className="text">Signup</Mytext>
    </div>

    {/* <div className="row"> */}
        <Maindiv className="col-6"> 
        <TextField id="Firstname" type="text" variant="outlined" label="Enter First Name" fullWidth/>
        <TextField id="email" type="text" variant="outlined" label="Enter First Name" />
        <TextField id="Password" type="text" variant="outlined" label="Enter First Name" />
        {/* <TextField id="Firstname" type="text" variant="outlined" label="Enter First Name" fullWidth/> */}
        {/* <div className="col-6"> </div>
    </div> */}
    </Maindiv>

    <div className="row m-2">
    {/* <TextField id="email" type="text" variant="outlined" label="Enter First Name" fullWidth/>
        <TextField id="Password" type="text" variant="outlined" label="Enter First Name" fullWidth/> */}
        <FormControlLabel control={
            <Checkbox icon={<CheckBoxOutlineBlank fontsize="small" />}
            checkedIcon={<Checkbox fontsize="small" />}
            name="checkedI" />
        }
        label="Remember me"
        />

        <Button variant="contained" color="primary">Create Account</Button>

         </div>
         <Divider variant="middle"/>
         <p className="text center">
             <Link to ="\Login">
                 Already have an account?
             </Link>
         </p>
         </Paper>
        </>
    )
}

export default Signup;
